       */
      !!@ ili2db.dispName = "Procedencia"
      Procedencia : LIST {0..*} OF LADM_COL_V1_3.LADM_Nucleo.CI_ParteResponsable;
      MANDATORY CONSTRAINT
        Fin_Vida_Util_Version >= Comienzo_Vida_Util_Version;
    END ObjetoVersionado;

